import React from "react";
import picture from './img/catalog/img.png'

class CatalogItem extends React.Component {
    render() {
        return (
            <div>
                <img src="picture" />
                <div>
                    <div>
                        <h2></h2>
                    </div>
                    <div>
                        <span></span>
                        <span></span>
                    </div>
                </div>
            </div>
        )
    }
}

export default CatalogItem
